import CartProduct from './CartProduct';

export default function Cart({cart, shops}) {
  return (
    <div className='container-fluid'>
        <div className=".flex-row">
        <div className='container'>
          <ol>
            {cart.length > 0 ? cart.map((data, index)=> {return <li key={index} ><CartProduct shops={shops} data={data}  /></li>}) : <h2>Your cart is empty</h2>}
            </ol>
            </div>
        </div>
    </div>
  )
}
